import "./card_styles.css"
function Card_layout() {
    
    var data = [
        {
            "album": "Unholy (feat. Kim Petras)",
            "artist": "Sam Smith",
            "cover_url": "https://i.scdn.co/image/ab67616d0000b273a935e4689f15953311772cc4",
            "name": "Unholy (feat. Kim Petras)",
            "track_id": "3nqQXoyQOWXiESFLlDF1hG",
            "url": "https://open.spotify.com/track/3nqQXoyQOWXiESFLlDF1hG"
        },
        {
            "album": "Quevedo: Bzrp Music Sessions, Vol. 52",
            "artist": "Bizarrap",
            "cover_url": "https://i.scdn.co/image/ab67616d0000b2731630dd349221a35ce03a0ccf",
            "name": "Quevedo: Bzrp Music Sessions, Vol. 52",
            "track_id": "2tTmW7RDtMQtBk7m2rYeSw",
            "url": "https://open.spotify.com/track/2tTmW7RDtMQtBk7m2rYeSw"
        },
        {
            "album": "I'm Good (Blue)",
            "artist": "David Guetta",
            "cover_url": "https://i.scdn.co/image/ab67616d0000b273933c036cd61cd40d3f17a9c4",
            "name": "I'm Good (Blue)",
            "track_id": "4uUG5RXrOk84mYEfFvj3cK",
            "url": "https://open.spotify.com/track/4uUG5RXrOk84mYEfFvj3cK"
        },
        {
            "album": "La Bachata",
            "artist": "Manuel Turizo",
            "cover_url": "https://i.scdn.co/image/ab67616d0000b273c9f744b0d62da795bc21d04a",
            "name": "La Bachata",
            "track_id": "5ww2BF9slyYgNOk37BlC4u",
            "url": "https://open.spotify.com/track/5ww2BF9slyYgNOk37BlC4u"
        }
      ]

  return(
    <section>
        <div class="container">
            <div class="carousel">
            { 
                    data.map((item, index) => (
                        
                            <input type="radio" name="slides" id={"slide-" + index}></input>
                        
                    )       

                    )
                } 
                <ul class="carousel__slides">



                {
                        
                    data.map((item) => (
                    
                    <li class="carousel__slide">
                        <figure>
                            <div>
                                <img src={item.cover_url} alt=""></img>
                            </div>
                            <figcaption>
                                {item.name}
                                {item.artist}
                                {item.album}
                                <span class="credit">Photo: Tim Marshall</span>
                            </figcaption>
                        </figure>
                    </li>
                    ))
                }
                </ul>
                <ul class="carousel__thumbnails">

                {
                        
                        data.map((item, index) => (
                        
                        <li>
                            <label for={"slide-" + index}><img src={item.cover_url} alt=""></img></label>
                        </li>
                        ))
                    }

                    
                </ul>
            </div>
        </div>
    </section>
  )
}

export default Card_layout;
